-2.700227124547304 -2.882701279621431 -3.0704059536373562 -2.9573900370209665 -3.2551211738527495 -3.433919150102399 -3.8471672480513632 -3.7868324963111357 -3.5930454551440527 -3.3958538265965323 -3.4280407434642317 -3.0396612062165853 -3.471627337393978 -3.3258134817574025 -3.183650656069361 -2.8123121604867873 -3.108526055498542 -2.9791279855847814 -3.2163689075136523 -3.3694946055840553 -3.1775172711065385 -3.1324518417033698 -3.5334279560376993 -3.8730680442227556 -3.461379350428417 -3.0332818520209095 -3.3313700546066443), :svgHeight 20}]]], \"3676\" [:div nil nil [:p/markdown \"### hidden\\n\\nA `:hidden` note does not render its value, and also does not show its code.\\n\\nHere is a note that you cannot see:\"]], \"3708\" [:div [:p/code {:code \"^kind/dataset-grid\\n{:x (range 9)\\n :y (repeatedly 9 rand)\\n :z (take 9 (cycle \\\"abc\\\"))}\", :bg-class \"bg-light\"}] nil [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"x\", :field \"x\"} {:headerName \"y\", :field \"y\"} {:headerName \"z\", :field \"z\"}], :rowData ({\"x\" 0, \"y\" 0.8955450781545058, \"z\" \\a} {\"x\" 1, \"y\" 0.5352762150481287, \"z\" \\b} {\"x\" 2, \"y\" 0.6314545609270047, \"z\" \\c} {\"x\" 3, \"y\" 0.4777239720349443, \"z\" \\a} {\"x\" 4, \"y\" 0.7081825697837233, \"z\" \\b} {\"x\" 5, \"y\" 0.3821722398975582, \"z\" \\c} {\"x\" 6, \"y\" 0.36773201142931555, \"z\" \\a} {\"x\" 7, \"y\" 0.8727754068028293, \"z\" \\b} {\"x\" 8, \"y\" 0.3023483592776709, \"z\" \\c})}]]], \"3695\" [:div nil nil [:p/markdown \"### code\"]], \"3670\" [:div [:p/code {:code \"^kind/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] nil [:big [:big 3]]], \"3667\" [:div nil nil [:p/markdown \"### Promises\\nComing soon.\"]], \"3668\" [:div nil nil [:p/markdown \"## Note kinds\\n\\nEach note has a kind, that determines its rendering behaviour.\\n\\nOne way to specify a note's kind is by metadata. For example, here is a note of kind `:hiccup`.\"]], \"3711\" [:div nil nil [:p/markdown \"--------------------\"]], \"3698\" [:div [:p/code {:code \"^kind/hiccup\\n[:p/code \\\"def abcd(x):\\n  return x+9\\\"\\n {:language :python}]\", :bg-class \"bg-light\"}] nil [:p/code \"def abcd(x):\\n  return x+9\" {:language :python}]], \"3643\" [:div [:p/code {:code \"(def d1 (delay 11))\", :bg-class \"bg-light\"}] nil nil], \"3731\" [:div [:p/code {:code \"(DummyType1. [:big [:big 3]])\", :bg-class \"bg-light\"}] nil [:big [:big 3]]], \"3641\" [:div nil nil [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]], \"3736\" [:div [:p/code {:code \"^just-code\\n[:div \\\"just some code\\\"]\", :bg-class \"bg-light\"}] nil nil], \"3678\" [:div nil nil [:p/markdown \"### md\\n\\nNotes of kind `:md` are rendering their values as markdown. More precisely, the value is printed, and the captured printed string is expected to be of Markdown format. If the value is sequential, then its elements are printed and concantenated as lines of one multi-line string, that is then treated as Markdown.\"]], \"3636\" [:div nil nil [:p/markdown \"# Notespace v3 intro\\n\\n[Notespace](https://github.com/scicloj/notespace) is a library that turns any Clojure namespace into a 'notespace' -- a namespace with a [notebook](https://en.wikipedia.org/wiki/Notebook_interface) experience. A notespace evolves in an interactive process of exploration, involving a dialogue of your editor, your REPL, your browser and your mind.\\n\\nSo, `Notespace` with a capital `N` is the name of the tool, and `notespace` with a small `n` is the notion that we just presented.\\n\\nHere we describe an experimental incomplete draft of Notespace Version 3.\\n\\nIt is still a bit buggy around handling concurrency, updating efficiently and connecting to the browser. But the current version should be enough to start a community discussion around where we should be taking this.\"]], \"3640\" [:div nil nil [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Notespace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]], \"3741\" [:div [:p/code {:code \"^kind/hiccup\\n(notespace/midje-summary)\", :bg-class \"bg-light\"}] nil [:div [:div \"Tests summary:\" [:div [:big [:big {:style {:color \"darkgreen\"}} \"âœ“\"]] \": \" 1]]]], \"3654\" [:div nil nil [:p/markdown \"### Delays\"]], \"3692\" [:div nil nil [:p/markdown \"### vega\"]], \"3703\" [:div [:p/code {:code \"^kind/hiccup\\n[:p/math\\n \\\"(ax ^2 + bx + c = 0 )\\\"]\", :bg-class \"bg-light\"}] nil [:p/math \"(ax ^2 + bx + c = 0 )\"]], \"3716\" [:div nil nil [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]], \"3684\" [:div [:p/code {:code \"^kind/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] nil [:big [:big 3]]], \"3647\" [:div [:p/code {:code \"d2\", :bg-class \"bg-light\"}] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"12\\n\"}]], \"3648\" [:div nil nil [:p/markdown \"### More API functions\\n\\nNotespace offers some more API functions that allow for a dynamic experience with Clojure references.\"]], \"3713\" [:div nil nil [:p/markdown \"--------------------\"]], \"3737\" [:div nil nil [:p/markdown \"## Midje tests\\n\\nTests of the Midje test framework are rendered as follows:\"]], \"3704\" [:div [:p/code {:code \"^kind/math\\n[\\\"(ax ^2 + bx + c = 0 )\\\"\\n \\\"(dx ^2 + ex + f = 0 )\\\"]\", :bg-class \"bg-light\"}] nil [:div [:p/math \"(ax ^2 + bx + c = 0 )\"] [:p/math \"(dx ^2 + ex + f = 0 )\"]]], \"3638\" [:div [:p/code {:code \"(+ 1 2\\n   3 4\\n   5 6)\", :bg-class \"bg-light\"}] nil [:p/code {:code \"21\\n\"}]], \"3650\" [:div nil nil [:p/markdown \"#### eval-and-realize-note-at-line\\n\\nUse `notespace.api/eval-and-realize-note-at-line` to evaluate the note at a certain line, realize the value if it is an unrealized derefable value, and inform Notespace about the result.\\n\\nFor example, `(notespace.api/eval-and-realize-note-at-line 14)` applies that to the note at line 14.\"]], \"3725\" [:div [:p/code {:code \"(-> [\\\"(ax ^2 + bx + c = 0 )\\\"]\\n    (kind/override kind/math))\", :bg-class \"bg-light\"}] nil [:div [:p/math \"(ax ^2 + bx + c = 0 )\"]]], \"3702\" [:div nil nil [:p/markdown \"### math\"]], \"3644\" [:div [:p/code {:code \"(def d2 (delay 12))\", :bg-class \"bg-light\"}] nil nil], \"3674\" [:div nil nil [:p/markdown \"### void\\n\\nA `:void` note does not render its value.\"]], \"3652\" [:div nil nil [:p/markdown \"#### eval-and-realize-notes-from-change\\n\\n Use `notespace.api/eval-and-realize-notes-from-change` to evaluate and realize all notes starting from the line where the file has changed in its last save, compared to the previous save.\"]], \"3720\" [:div nil nil [:p/markdown \"## Interactive input and reactive notes\\n\\nComing soon.\"]], \"3637\" [:div nil nil [:p/markdown \"## Notes\\n\\nHere is a note:\"]], \"3651\" [:div nil nil [:p/markdown \"#### eval-and-realize-notes-from-line\\n\\nUse `notespace.api/eval-and-realize-notes-from-line` to evaluate and realize all notes starting from a certain line, and inform Notespace.\"]], \"3681\" [:div nil nil [:p/markdown \"### md-nocode\\n\\nNotes of kind `:md-nocode` are rendered as Markdown too, but without showing the code. Here is an example:\"]], \"3690\" [:div [:p/code {:code \"(require '[gorilla-notes.components.leaflet.providers :as leaflet-providers])\", :bg-class \"bg-light\"}] nil nil], \"3666\" [:div [:p/code {:code \"^kind/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] nil nil], \"3659\" [:div nil nil [:p/markdown \"If a note's value is a future, then Notespace will be informed when that future is realized. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example, the following note should render after two seconds (of waiting for `x` to be realized).\"]], \"3694\" [:div [:p/code {:code \"^kind/vega\\n{\\n  :description \\\"A simple bar chart with embedded data.\\\"\\n  :data {\\n    :values [\\n      {:a \\\"A\\\" :b 28} {:a \\\"B\\\" :b 55} {:a \\\"C\\\" :b 43}\\n      {:a \\\"D\\\" :b 91} {:a \\\"E\\\" :b 81} {:a \\\"F\\\" :b 53}\\n      {:a \\\"G\\\" :b 19} {:a \\\"H\\\" :b 87} {:a \\\"I\\\" :b 52}\\n    ]\\n  }\\n  :mark :bar\\n  :encoding {\\n    :x {:field :a :type :nominal :axis {:labelAngle 0}}\\n    :y {:field :b :type :quantitative}\\n  }\\n}\", :bg-class \"bg-light\"}] nil [:p/vega {:description \"A simple bar chart with embedded data.\", :data {:values [{:a \"A\", :b 28} {:a \"B\", :b 55} {:a \"C\", :b 43} {:a \"D\", :b 91} {:a \"E\", :b 81} {:a \"F\", :b 53} {:a \"G\", :b 19} {:a \"H\", :b 87} {:a \"I\", :b 52}]}, :mark :bar, :encoding {:x {:field :a, :type :nominal, :axis {:labelAngle 0}}, :y {:field :b, :type :quantitative}}}]], \"3664\" [:div [:p/code {:code \"a\", :bg-class \"bg-light\"}] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"{:x 3}\\n\"}]], \"3683\" [:div nil nil [:p/markdown \"# ee `{:x 3}`.\"]], \"3727\" [:div nil nil [:p/markdown \"## Inferring note behaviors from types\\nIt is possible to infer a note's behavior from the type of its rendered, overriding the behavior prescribed by its kind. This can be done by extending the `Behaving` protocol.\"]], \"3733\" [:div [:p/code {:code \"(defmethod\\n  ^{:doc\\n    \\\"Example of user extensible kind.\\nNote the ':reload true' in the :require vector:\\n[notespace.kinds :as k :reload true].\\nThis will make REPL testing your extensible kind easier!\\\"}\\n  kind/kind->behaviour ::just-code\\n  [_]\\n  {:render-src?   true\\n   :value->hiccup (constantly nil)})\", :bg-class \"bg-light\"}] nil [:p/code {:code \"#multifn[kind->behaviour 0x8afc435]\\n\"}]], \"3679\" [:div [:p/code {:code \"^kind/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}] nil [:p/markdown \"##### text:\\n* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\"]], \"3709\" [:div nil nil [:p/markdown \"--------------------\"]], \"3656\" [:div [:p/code {:code \"(delay (+ 1 2))\", :bg-class \"bg-light\"}] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(delay - not running yet ...)\"]] [:p/code {:code \"nil\\n\"}]], \"3732\" [:div nil nil [:p/markdown \"## Extending Notespace with new note kinds.\"]], \"3729\" [:div [:p/code {:code \"(deftype DummyType1 [data]\\n  notespace.behavior/Behaving\\n  (->behavior [this]\\n    {:render-src? true\\n     :value->hiccup (fn [v] data)}))\", :bg-class \"bg-light\"}] nil nil], \"3723\" [:div nil nil [:p/markdown \"## Overriding note kinds at runtime\\nIt is possible to override a note's kind during its evaluation using the `notespace.kinds/override` functions.\"]], \"3669\" [:div [:p/code {:code \"(require '[notespace.kinds :as k])\", :bg-class \"bg-light\"}] nil nil], \"3673\" [:div nil nil [:p/markdown \"This is the default kind, so usually there is no need to mention it.\"]], \"3699\" [:div nil nil [:p/markdown \"Such tags can usually be handled through dedicated kinds too.\"]], \"3642\" [:div nil nil [:p/markdown \"## References\\n\\nClojure references such as delays, futures, promises and atoms are handled by Notespace in a special way. Below we will see how Notespace offers ways to bring the dynamic REPL experience of such constructs to the dynamic browser view.\\n\\n### The rule of rendering\\n\\nAssume that a note's evaluation result `x` is a reference.\\n\\nIf `x` is already realized, then Notespace renders `@x` (dereferenced `x`) instead of `x`. In the rendering value, this is marked by `(dereferenced)`.\\n\\nOtherwise, you should see a mark that says it is still pending.\\n\\n\\nFor example:\"]], \"3730\" [:div [:p/code {:code \"(future\\n  (Thread/sleep 2000)\\n  (->> #(- (rand) 0.5)\\n       (repeatedly 9)\\n       (reductions +)))\", :bg-class \"bg-light\"}] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"(0.3368910471937052\\n 0.7600372128651983\\n 0.643336292238301\\n 0.7934861601129154\\n 0.9338549277944014\\n 0.9024322364805851\\n 0.49445781457064664\\n 0.6143777948383333\\n 0.5594453230346896)\\n\"}]], \"3653\" [:div nil nil [:p/markdown \"### Listening to changes\\n\\n`(notespace.api/listen)` will tell Notespace to listen to changes in the file corresponding to the current namespace (on a file save). When changes occur, (notespace.api/eval-and-realize-notes-from-change) is called. This results in an [Oz](https://github.com/metasoarous/oz)-like live-reload experience.\\n\\n`(notespace.api/unlisten)` will tell Notespace to stop listening to the current namespace.\"]], \"3715\" [:div [:p/code {:code \"^kind/html\\n(str \\\"<h4>h4</h4>\\\"\\n     \\\"<h5>h5</h5>\\\")\", :bg-class \"bg-light\"}] nil [:p/html \"<h4>h4</h4><h5>h5</h5>\"]], \"3662\" [:div nil nil [:p/markdown \"If a note's value is an atom, then Notespace will be informed when its value changes. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]], \"3677\" [:div nil nil nil], \"3646\" [:div [:p/code {:code \"d1\", :bg-class \"bg-light\"}] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(delay - not running yet ...)\"]] [:p/code {:code \"nil\\n\"}]], \"3728\" [:div [:p/code {:code \"(require '[notespace.behavior])\", :bg-class \"bg-light\"}] nil nil], \"3717\" [:div nil nil [:p/markdown \"Notes which are forms like `(def ...)` or `(defn ...)` are assigned the kind `:void`.\"]], \"3663\" [:div [:p/code {:code \"(def a\\n  (atom {:x 3}))\", :bg-class \"bg-light\"}] nil nil], \"3718\" [:div nil nil [:p/markdown \"All other notes witn no explicit metadata are assigned the kind `:naive` automatically.\"]], \"3734\" [:div [:p/code {:code \"(def ^{:doc \\\"When making a user extensible kind, you MUST assign the keyword\\nto a variable. Annotating with a keyword WILL NOT WORK!\\\"} just-code ::just-code)\", :bg-class \"bg-light\"}] nil nil], \"3655\" [:div nil nil [:p/markdown \"If a note's value is a delay, then you can call `notespace.api/eval-and-realize-note-at-line` or `notespace.api/eval-and-realize-this-notespace` to realize it. Notespace will update its state with the dereferenced value.\\n\\nFor example:\"]], \"3645\" [:div [:p/code {:code \"(deref d2)\", :bg-class \"bg-light\"}] nil [:p/code {:code \"12\\n\"}]], \"3671\" [:div nil nil [:p/markdown \"Let us see what kinds of notes we have.\\n\\n### naive\\n\\nA `:naive` note renders its value by pretty-printing it.\"]], \"3686\" [:div nil nil [:big [:big 3]]]}}");
